script: |
  super -f text -I q7776.spq | sort > q7776.out

inputs:
  - name: q7776.spq
    data: |
      SELECT ALL COUNT ( * ) / 90 + - MIN ( + - 19 ) AS col2 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1

outputs:
  - name: q7776.out
    data: |
      19
